    state = {}
    render() {
        return (
            <div className="footer">
                <div className="container">


                    <div className="customers_service">


                    </div>




                    <div className="write">
                        <i class="fas fa-envelope"></i>
                        Masz pytanie? Skontaktuj siÄ™!
                    </div>


                    <div className="icons">
                        <i class="fab fa-facebook-square"></i>
